Here's an example of a Python program that prints out the first 100 prime numbers:

```python
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

count = 0
num = 2
while count < 100:
    if is_prime(num):
        print(num)
        count += 1
    num += 1
```

This program defines a helper function `is_prime()` that checks whether a number is prime or not. Then, it initializes two variables - `count` to keep track of the number of prime numbers found so far and `num` as a starting point (2 in this case). It uses a while loop to continue until it finds 100 prime numbers. In each iteration, it checks if the current number is prime using the `is_prime()` function and prints it out if it is. Finally, it increments both `count` and `num`.
